import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { fetchTransactions } from "../api";
import {
  Container,
  Typography,
  Button,
  Box,
  Card,
  CardContent,
  Grid,
  List,
  ListItem,
  ListItemAvatar,
  ListItemText,
  Avatar,
  CircularProgress,
  Alert,
} from "@mui/material";
import HistoryIcon from "@mui/icons-material/History";
import AccountBalanceWalletIcon from "@mui/icons-material/AccountBalanceWallet";
import ArrowUpwardIcon from "@mui/icons-material/ArrowUpward";
import ArrowDownwardIcon from "@mui/icons-material/ArrowDownward";

export default function Transactions() {
  const [transactions, setTransactions] = useState<any[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const navigate = useNavigate();

  useEffect(() => {
    const storedUser = localStorage.getItem("user");
    if (!storedUser) {
      navigate("/");
      return;
    }

    const user = JSON.parse(storedUser);

    fetchTransactions(user.id)
      .then((data) => {
        setTransactions(data);
        setLoading(false);
      })
      .catch((error) => {
        setError("–û—à–∏–±–∫–∞ –∑–∞–≥—Ä—É–∑–∫–∏ —Ç—Ä–∞–Ω–∑–∞–∫—Ü–∏–π. –ü–æ–ø—Ä–æ–±—É–π—Ç–µ –ø–æ–∑–∂–µ.");
        setLoading(false);
      });
  }, [navigate]);

  return (
    <Container maxWidth="md">
      <Box mt={5} sx={{ textAlign: "center" }}>
        <Typography variant="h3" fontWeight="bold">
          üìú –ò—Å—Ç–æ—Ä–∏—è —Ç—Ä–∞–Ω–∑–∞–∫—Ü–∏–π
        </Typography>
      </Box>

      {/* –ò–Ω—Ñ–æ—Ä–º–∞—Ü–∏–æ–Ω–Ω–∞—è –∫–∞—Ä—Ç–æ—á–∫–∞ */}
      <Card sx={{ mt: 4, p: 3, boxShadow: 3 }}>
        <CardContent sx={{ display: "flex", alignItems: "center", justifyContent: "space-between" }}>
          <Box sx={{ display: "flex", alignItems: "center" }}>
            <AccountBalanceWalletIcon sx={{ fontSize: 50, color: "blue", mr: 2 }} />
            <Typography variant="h6">–í–∞—à–∏ –ø–æ—Å–ª–µ–¥–Ω–∏–µ –ø–µ—Ä–µ–≤–æ–¥—ã:</Typography>
          </Box>
          <Typography variant="h5">{transactions.length} –æ–ø–µ—Ä–∞—Ü–∏–π</Typography>
        </CardContent>
      </Card>

      {/* –°–ø–∏—Å–æ–∫ —Ç—Ä–∞–Ω–∑–∞–∫—Ü–∏–π */}
      <Box mt={4}>
        {loading ? (
          <Box sx={{ display: "flex", justifyContent: "center", mt: 4 }}>
            <CircularProgress size={50} />
          </Box>
        ) : error ? (
          <Alert severity="error" sx={{ mt: 2 }}>
            {error}
          </Alert>
        ) : transactions.length === 0 ? (
          <Alert severity="info" sx={{ mt: 2 }}>
            –ù–µ—Ç —Ç—Ä–∞–Ω–∑–∞–∫—Ü–∏–π
          </Alert>
        ) : (
          <List>
            {transactions.map((t) => (
              <Card key={t.id} sx={{ mt: 2, boxShadow: 2 }}>
                <CardContent>
                  <ListItem>
                    <ListItemAvatar>
                      <Avatar sx={{ bgcolor: t.user.name === JSON.parse(localStorage.getItem("user") || "{}").name ? "red" : "green" }}>
                        {t.user.name === JSON.parse(localStorage.getItem("user") || "{}").name ? <ArrowUpwardIcon /> : <ArrowDownwardIcon />}
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText
                      primary={`${t.user.name} ‚Üí ${t.toUser}`}
                      secondary={`–°—É–º–º–∞: $${t.amount} | –î–∞—Ç–∞: ${t.timestamp}`}
                    />
                  </ListItem>
                </CardContent>
              </Card>
            ))}
          </List>
        )}
      </Box>

      {/* –ö–Ω–æ–ø–∫–∞ "–ù–∞–∑–∞–¥" */}
      <Grid container justifyContent="center" sx={{ mt: 4 }}>
        <Grid item xs={12} sm={6}>
          <Button
            fullWidth
            variant="contained"
            color="primary"
            startIcon={<HistoryIcon />}
            sx={{ py: 2, fontSize: 18 }}
            onClick={() => navigate("/dashboard")}
          >
            –í–µ—Ä–Ω—É—Ç—å—Å—è –≤ –∫–∞–±–∏–Ω–µ—Ç
          </Button>
        </Grid>
      </Grid>
    </Container>
  );
}
